import "../App.css";
import React from 'react';


const Line = (props) => {
    return (
      <ul className="Line">
        <li onChange={props.handleChange.slice(0, 16)} onClick={() => navigator.clipboard.writeText(props.symbol.slice(0, 16))}>
          <p>{props.title}</p>
          <p>{props.symbol}</p>
        </li>
      </ul>
    );
  };


export default Line;
